import './App.css';
import micon from './assets/micon.webp';
import picon from './assets/picon.png';
import p1 from './assets/p1.png';
import p2 from './assets/p2.png';
import p3 from './assets/p3.png';
import mike from "./assets/mike.png";
import mr from "./assets/mr.png";
import pix from "./assets/pix.png";
import deg from "./assets/deg.png";
import Teamp from "./team";
import me from "./assets/me.svg";
import mainf from "./assets/mainf";
import lastm from "./assets/lastm"
import { FaDiscord } from 'react-icons/fa';
import { FaTwitter} from 'react-icons/fa';

import s1 from "./assets/s1.png";
import s2 from "./assets/s2.png";
import s3 from "./assets/s3.png";
import s4 from "./assets/s4.jpeg";
import s5 from "./assets/s5.png";
import s6 from "./assets/s6.png";
import s7 from "./assets/s7.jpeg";
import s8 from "./assets/s8.png";
import s9 from "./assets/s9.png";
import s10 from "./assets/s10.png";


function App() {
  return (
    <div className="App">
      <div className="head">
      <a href='https://twitter.com/MNFSTLabs' target="_blank"><img src={micon} className='icon'/></a>
      <a href='https://twitter.com/0xPolygon' target="_blank"><img src={picon} className='icon'/></a>
      </div>
      <h1 className='mheadt'>BITCOIN WHALES</h1>
      <div className='three'>
      <img src={p1} className='p1'/>
      <img src={p3} className='p2'/>
      <img src={p2} className='p3'/>
      </div>
      <div className='line'></div>
      <h1 className='minfo'>WHAT IS BITCOIN WHALES?</h1>

      <p className='infop'>Bitcoin Whales is a timeless digital art collection that is home to a community of creators, philanthropists, and entrepreneurs that fosters the desire to make history on ordinals. We aspire to provide genuine and meaningful experiences to connect with artists and builders where they can see our community as a safe haven.</p>

      <div className='sbody'>
      <section class="scrollport">
  <div><img src={s1}/></div>
  <div><img src={s2}/></div>
  <div><img src={s3}/></div>
  <div><img src={s4}/></div>
  <div><img src={s5}/></div>
  <div><img src={s6}/></div>
  <div><img src={s7}/></div>
  <div><img src={s8}/></div>
  <div><img src={s9}/></div>
  <div><img src={s10}/></div>
</section></div>
    <div className='mmn'>
    Meet The Team
    </div>
    <div className="mainpd">

    <div className="mainpd1">
    <a href = "https://twitter.com/MrMintETH/"target="_blank" >
    <Teamp name = "MRMINT.ETH" dis ="Founder" pfp = {mr}/>
    </a>

    <a href = "https://twitter.com/pixxelznft" target="_blank">
    <Teamp name = "PIXXELZ.ETH" dis ="Head of Marketing" pfp = {pix}/>
    </a>
    </div>

    <div className="mainpd1">
    <a href = "https://twitter.com/mikeejt" target="_blank">
    <Teamp name = "MIKEEJT" dis ="Dev Lead" pfp = {mike}/>
    </a>


    <Teamp name = "DEGENNL" dis ="Prpject Manager" pfp = {deg}/>

    </div>
    </div>
    <img src= {mainf} className='mainf'/>
    <h2 className='minte'>Mint and Trade Exclusively on</h2>
    <a href='https://magiceden.io/launchpad/polygon/ring_runnerz' target="_blank"><img src= {me} className='me'/></a>

    <div className='lastm' >
    <div className = "icond">
    <a href = "https://discord.gg/mnfstlabs" target="_blank" >
    <FaDiscord className='icont'/>
    </a>
    <a href = "https://twitter.com/RingRunnerz" target="_blank">
    <FaTwitter className='icont'/>
    </a>
    </div>
    <div className='lastb'>
    <p className='created'> created with ❤️ by </p><a href= "https://twitter.com/yeahbichscience" target="_blank"> 
    <p className='italics'>yeahbitchscience</p>
    </a>
    </div>
    </div>
    </div>
  );
}

export default App;
